// frontend/src/components/ui/card.jsx
import React from 'react';
import classNames from 'classnames';

const Card = ({ children, className = '', ...props }) => {
  return (
    <div
      className={classNames(
        'bg-white p-6 rounded-lg shadow-md',
        className
      )}
      {...props}
    >
      {children}
    </div>
  );
};

export default Card;
